import { connect } from 'react-redux';

const PostPage = (props) => <div>{`store.value is ${props.detail}`}</div>;

const mapStateToProps = state => {
  return {
    detail: state.views.data,
  };
}

export default connect(mapStateToProps)(PostPage);
